import React, { useEffect, useState } from 'react'

const Challenge2 = () => {
    const [num , setnum] = useState(0)
    useEffect(() => {
        alert('hu')
    })
  return (
    <>
      <button onClick={
       () => {
        setnum(num + 1);
       }
      }
      >
         Clicked Me {num} </button>
    </>
  )
}

export default Challenge2
